Microphones and stands therefor; loudspeakers, whether or not mounted in their enclosures; headphones and
earphones, whether or not combined with a microphone, and sets consisting of a microphone and one or more loudspeakers;
audio-frequency electric amplifiers; electric sound amplifier set

Parts of the following goods, namely:-
(i) Crutches;
(ii) Wheel chairs;
(iii) Walking frames;
(iv) Tricycles;
(v) Braillers; and
(vi) Artificial limbs

